def getCountries(tokens):
	countries = getData("countries")
	votes = [0] * len(countries)
	for token in tokens:
		l = list(map(lambda x: int(token.lower() in x.split(' ')), countries))
		votes = list(map(add, votes, l))
	maxval = max(votes)
	if maxval == 0:
		return []
	ind = [i for i, v in enumerate(votes) if v == maxval]
	possible_countries = [countries[i] for i in ind]
	return possible_countries

